import React from "react";
import Note from "./Note";

function Notes() {
  return (
    <div>
      <Note h="Wow" p="For real" />
      <Note h="Nice" p="This is crazy" />
      <Note h="Gomamon" p="Yes, gomamon" />
    </div>
  );
}

export default Notes;
